import React from "react";
import Chip from "@mui/material/Chip";
import Stack from "@mui/material/Stack";

const Shifter = (props) => {
    const timeEmloyee = `${props.time} - ${props.employee}`;
  return (

      <Chip
        label={timeEmloyee}
        color="success"
      />
  );
};

export default Shifter;
